import { useState } from 'react'

const Button = ({ color }) => {

    const [count, setCount] = useState(0)

    function handleClick() {
        setCount(count+1)
    }

  return (
    <button style={{color: color}} onClick={handleClick}>
        Clicked {count} Times!
    </button>
  )
}

export default Button
